import React from 'react';
import {Link} from 'react-router-dom';

function Navigation() {
    return (
        <nav className = 'App-nav'>
            <Link to="/">Home       </Link>
            <Link to="/create-exercise">Add Exercise</Link>
        </nav>
    )
}
export default Navigation;
